import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import PersonIcon from '@material-ui/icons/Person';
import { deepPurple } from '@material-ui/core/colors';
import Avatar from '@material-ui/core/Avatar';
import UploadButton from './uploadbutton';

import ResultTable from './resulttable';

import FileList from './filelist';
import KPMGlogo from '../../static/KPMG_logo_white.svg';
import PopUp from './popup';

const user = "user_name";

const useStyles = makeStyles((theme) => ({
    root: {
        height: '100%',
        width: '100%',
    },
    container: {
        border: 'solid',
    },
}));



export default function Main() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Box height={900}>

                <div style={{ color: 'white' }}>LIBOR</div>
                <div style={{ backgroundColor: 'rgba(251,161,0, 0.5)' }}>
                    <Grid container justify="center" >
                        <div style={{ border: 'solid', width: '100%' }}>dsssd</div>
                        file upload
                    </Grid>
                    <Container maxWidth="lg" className={classes.container}></Container>
                </div>
                <div style={{ backgroundColor: 'rgba(107, 186, 167, 0.5)' }}>HEllo</div>
            </Box>
        </div>
    );
}
